import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { StyleSheet, Text, View, Button, Alert} from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/native' ;
import styles from './styles/Button.component.style.js';
import moment from 'moment';

var date = moment().utcOffset('-05:00').format('YYYY-MM-DD hh:mm:ss a');


class Buttom extends Component {
  render() {
  return (
    <View style={styles.container}>
      <Text style={styles.buttonText}> Press! </Text>
    </View>
  );
  }
}

export default function App() {
  return (
    <View style={styles.container}>
      <Text>{date}</Text>
      <Text style={styles.title}>Yo</Text>

      <Button
       color="#20232a"
       title="Click Me" 
       onPress={() => alert('Button pressed')}
       />

      <StatusBar style="auto" />
    </View>

  ); 
}
